import React from 'react'
import { NavLink } from 'react-router-dom'

const NavBar = () => {
    return (
        <nav>
            <ul>
                <li><NavLink to="/" /></li>
                <li><NavLink to="/food" /></li>
            </ul>
            
        </nav>
    )
}

export default NavBar
